import React, { Component } from "react";

export default class Header extends Component {
    render() {
        return(
            <header>
                <ul>
                    <li className="logoHeader"></li>
                    <li>Home</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
            </header>
        )
    }
}
